description:
The White Stripes is an American rock duo, formed in 1997 in Detroit, Michigan. 
The group consists of songwriter Jack White (vocals, guitar, piano, and once bass) 
and Meg White (drums and occasional vocals).

After releasing several singles and three albums within the Detroit independent music underground, 
The White Stripes rose to prominence in 2002, 
as part of the garage rock revival scene. 
Their successful albums White Blood Cells and Elephant drew them attention 
from a large variety of media outlets in the United States and the United Kingdom.

This Album set for release around 16th March 2010

